// src/components/FlightBooking.js
import React, { useState } from 'react';

function FlightBooking() {
  const [destination, setDestination] = useState('');
  const [dates, setDates] = useState({ departure: '', return: '' });
  const [passengers, setPassengers] = useState(1);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Logique de réservation de vol
    console.log('Réservation de vol:', { destination, dates, passengers });
  };

  return (
    <div>
      <h2>Réservation de Vol</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Destination"
          value={destination}
          onChange={(e) => setDestination(e.target.value)}
          required
        />
        <input
          type="date"
          placeholder="Date de départ"
          value={dates.departure}
          onChange={(e) => setDates({ ...dates, departure: e.target.value })}
          required
        />
        <input
          type="date"
          placeholder="Date de retour"
          value={dates.return}
          onChange={(e) => setDates({ ...dates, return: e.target.value })}
          required
        />
        <input
          type="number"
          placeholder="Nombre de passagers"
          value={passengers}
          onChange={(e) => setPassengers(e.target.value)}
          min="1"
          required
        />
        <button type="submit">Réserver le vol</button>
      </form>
    </div>
  );
}

export default FlightBooking;
